In einem Topf kombinieren Erdnussbutter, Frischkäse, Chilisoße und Sojasoße;
         Schneebesen in 3/4 Tasse heißes Teigwasser. Rühre über mittlere Hitze bis erhitzt durch. Wenn die Mischung zu dick ist, unterrühren Sie zusätzliches Wasser.
         Rühren Sie in den meisten der grünen Zwiebeln. Servieren Sie Sauce über Nudeln mit Süßkartoffeln und restlichen grünen Zwiebelscheiben.
